import { Configuration } from '@virtualpatterns/mablung-configuration'
import { Console } from 'console'
import { Is } from '@virtualpatterns/mablung-is'
import EventEmitter from 'events'
import FileSystem from 'fs-extra'
import Path from 'path'
import Stream from 'stream'

import { Null } from './null.js'

import { ChildProcessSignalError } from './error/child-process-signal-error.js'

class ChildProcess extends EventEmitter {

  constructor(userPath, userParameter = {}, userOption = {}) { // 
    super()

    let processPath = userPath
    let processParameter = Configuration.getParameter(this._defaultParameter, userParameter)
    let processOption = Configuration.getOption(this._defaultOption, userOption)

    let process = this._createProcess(processPath, processParameter, processOption)

    this._processPath = processPath
    this._processParameter = processParameter
    this._processOption = processOption

    this._process = process

    this._console = new Null()

    this._stream = null
    this._streamOption = null

    this._attach()

  }

  /* c8 ignore next 1 */
  _createProcess(/* path, parameter, option */) {}

  _attach() {

    this._process.on('message', this.__onMessage = (message) => {
      // this._console.log('ChildProcess.on(\'message\', this.__onMessage = (message) => { ... })')
      // this._console.dir(message)

      try {
        this._onMessage(message)
      /* c8 ignore next 3 */
      } catch (error) {
        this._console.error(error)
      }

    })

    this._process.on('error', this.__onError = (error) => {
      this._console.error('ChildProcess.on(\'error\', this.__onError = (error) => { ... })')
      this._console.error(error)

      try {
        this._detach()
        this._onError(error)
      /* c8 ignore next 3 */
      } catch (error) {
        this._console.error(error)
      } finally {
        this._console = new Null()
      }

    })

    this._process.on('disconnect', this.__onDisconnect = () => {
      this._console.log('ChildProcess.on(\'disconnect\', this.__onDisconnect = () => { ... })')

      try {
        this._onDisconnect()
      /* c8 ignore next 3 */
      } catch (error) {
        this._console.error(error)
      }

    })

    this._process.on('exit', this.__onExit = (code, signal) => {
      this._console.log(`ChildProcess.on('exit', this.__onExit = (${code}, ${Is.null(signal) ? signal : `'${signal}'`}) => { ... })`)

      try {

        this._detach()

        if (Is.not.null(code)) {
          this._onExit(code)
          /* c8 ignore next 5 */
        } else if (Is.not.null(signal)) {
          this._onKill(signal)
        } else {
          this._onExit(0)
        }

      /* c8 ignore next 3 */
      } catch (error) {
        this._console.error(error)
      } finally {
        this._console = new Null()
      }

    })

  }

  _detach() {

    if (this.__onExit) {
      this._process.off('exit', this.__onExit)
      delete this.__onExit
    }

    if (this.__onDisconnect) {
      this._process.off('disconnect', this.__onDisconnect)
      delete this.__onDisconnect
    }

    if (this.__onError) {
      this._process.off('error', this.__onError)
      delete this.__onError
    }

    if (this.__onMessage) {
      this._process.off('message', this.__onMessage)
      delete this.__onMessage
    }

  }

  _onMessage(message) {
    this.emit('message', message)
  }

  _onError(error) {
    this.emit('error', error)
  }

  _onDisconnect() {
    this.emit('disconnect')
  }

  _onExit(code) {
    this.emit('exit', code)
  }

  _onKill(signal) {
    this.emit('kill', signal)
  }

  /* c8 ignore next 3 */
  get path() {
    return this._processPath
  }

  get _defaultParameter() {
    return {}
  }

  /* c8 ignore next 3 */
  get parameter() {
    return this._processParameter
  }

  get _defaultOption() {
    return {
      'serialization': 'advanced',
      'stdio': 'pipe'
    }
  }

  get option() {
    return this._processOption
  }

  get console() {
    return this._console
  }

  get pid() {
    return this._process.pid
  }

  get isConnected() {
    return this._process.connected
  }

  writeTo(path, option = { 'autoClose': true, 'emitClose': true, 'encoding': 'utf8', 'flags': 'a+' }) {

    let stream = null

    switch (true) {
      /* c8 ignore next 3 */
      case path instanceof Stream.Writable:
        stream = path
        break
      default:
        FileSystem.ensureDirSync(Path.dirname(path))
        stream = FileSystem.createWriteStream(path, option)
    }

    this._process.stderr.pipe(stream, { 'end': false })
    this._process.stdout.pipe(stream, { 'end': false })

    this._console = new Console({
      'colorMode': false,
      'ignoreErrors': false,
      'stderr': stream,
      'stdout': stream
    })

    this._stream = stream
    this._streamOption = option

  }

  send(message) {
    // this._console.log('ChildProcess.send(message) { ... }')
    // this._console.dir(message)

    return new Promise((resolve, reject) => {

      this._process.send(message, (error) => {

        if (Is.null(error)) {
          resolve()
        } else {
          reject(error)
        }

      })

    })

  }

  disconnect() {
    this._process.disconnect()
  }

  signal(signal) {

    if (this._process.kill(signal)) {
      // do nothing
    /* c8 ignore next 3 */
    } else {
      throw new ChildProcessSignalError(signal, this._process.pid)
    }

  }

  kill(signal = 'SIGINT') {
    this.signal(signal)
  }

}

export { ChildProcess }

import Clone from 'clone'
import FileSystem from 'fs'
import FileSystemPath from 'path'
import { Is } from '@virtualpatterns/mablung-is'
import JSON5 from 'json5'
import Merge from 'deepmerge'
import ObjectPath from 'object-path'
// import URL from 'url'

const PATTERN_JSON = /^.+\.json5?$/i

class Configuration {

  constructor(root = {}) {
    this._root = root
  }

  get root() {
    return this._root
  }

  async load(value) {
    this._root = await this._load(value)
  }

  async merge(value) {
    this._root = Configuration.merge(this._root, await this._load(value))
  }

  async _load(value) {

    if (Is.string(value)) {

      let path = FileSystemPath.resolve(value)

      if (PATTERN_JSON.test(path)) {
        return JSON5.parse(FileSystem.readFileSync(path, { 'encoding': 'utf-8' }))
      }
      else {

        let module = null
        module = await import(path) // URL.pathToFileURL(path))
        module = module.default || module

        if (Is.functionOrAsyncFunction(module)) {

          // let returnValue = null
          // returnValue = module(this)
          // returnValue = returnValue instanceof Promise ? await returnValue : returnValue

          return await module(this) // returnValue

        } else {
          return module
        }

      }

    } else {
      return value
    }

  }

  has(...parameter) {
    return ObjectPath.has.apply(ObjectPath, [this._root, ...parameter])
  }

  get(...parameter) {
    return ObjectPath.get.apply(ObjectPath, [this._root, ...parameter])
  }

  set(...parameter) {
    return ObjectPath.set.apply(ObjectPath, [this._root, ...parameter])
  }

  static merge(...parameter) {
    // Merge a set of objects
    return parameter.reduce((accumulator, parameter) => Merge(accumulator, parameter), {})
  }

  static getOption(...parameter) {
    return this.merge(...parameter)
  }

  static getParameter(...parameter) {
    // Combine the below
    return this._parameterObjectToArray(this._mergeParameter(...parameter))
  }

  static _mergeParameter(...parameter) {
    // Merge a set of objects or arrays so that
    // { 'a': true, 'b': false, 'c': 'abc' } and [ 'b', 'd', 'e', 'f' ] and ...
    // becomes { 'a': true, 'b': true, 'c': 'abc', 'd': true, 'e': true, 'f': true }
    return parameter.reduce((accumulator, parameter) => Merge(accumulator, Is.array(parameter) ? this._parameterArrayToObject(parameter) : parameter), {})
  }

  static _parameterArrayToObject(value) {
    // Convert a parameter array of [ 'a', 'b', 'c' ] 
    // into an object { 'a': true, 'b': true, 'c': true }
    return value.reduce((accumulator, value) => { 
      accumulator[value] = true 
      return accumulator
    }, {})
  }

  static _parameterObjectToArray(value) {
    // Convert a parameter object { 'a': true, 'b': false, 'c': 'abc', 'd': 1, 'e': 0 }
    // into an array [ 'a', 'c', 'abc', 'd', 1, 'e', 0 ]
    return Object.entries(value) // returns [ [ name, value ], [ name, value ], ... ]
      .filter(([ , value ]) => Is.boolean(value) ? value : true) // if value is a boolean, filter out false values
      .map(([ name, value ]) => Is.boolean(value) ? [ name ]: [ name, value ]) // if value is a boolean return only [ name ]
      .flat()
  }

  static redact(value, path, censor = '**********') {

    let _value = null
    _value = Clone(value)

    ObjectPath.set(_value, path, censor)

    return _value

  }

  static omit(value, path) {

    let _value = null
    _value = Clone(value)

    ObjectPath.del(_value, path)

    return _value

  }

}

export { Configuration }

import IsNode from 'is-node'
import IsWindows from 'is-windows'

function Bundle(utility) {

  utility.addPredicate('functionOrAsyncFunction', (value) => {
    return typeof value === 'function'
  })

  utility.addPredicate('emptyArray', (value) => {
    return Array.isArray(value) && value.length == 0
  })

  utility.addPredicate('windows', () => {
    return IsWindows()
  })

  utility.addPredicate('server', () => {
    return IsNode
  })

  utility.addPredicate('browser', () => {
    return !IsNode
  })

}

